import React from 'react';

export default class User extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            loading: true,
            value: null
        };
    }
    componentDidMount() {
        fetch('http://localhost:8080/getUser')
            .then(res => res.json())
            .then(items=>this.setState({items}))
    }

    render() {
        const {items} = this.state;
        return (
            <ul>
                {items.map(item => (
                    <li key={item.response}>
                        {item.response}
                    </li>
                ))}
            </ul>
        );
    }
}
